function get(e){if(!/MSIE|Trident/.test(window.navigator.userAgent)){var r=new URL(window.location.href).searchParams.get(e);return r||void 0}var n=window.location.href.replace(new RegExp("\\+","g"),"%20").split("?");if(0==n.length)return"";if(n[1]){var t=n[1].split("&"),a="";for(i=0;i<t.length;i++){var o=t[i].split("=");if(o[0]==e){a=o[1];break}}return(a=unescape(a)).replace("+"," "),a}}
